import axios from "axios";
import React, { useState, useEffect } from "react";

const Test = () => {
  let [test, testChange] = useState();

  useEffect(() => {
    axios.get("http://localhost:8181/sample/read").then((result) => {
      testChange(result);
    });
  }, []);

  return (
    <div>
      <p id="one">오늘 크롤링은 어ㅓ셨나요?</p>
      <p id="two">괜츈?</p>
      <button
        onClick={() => {
          console.log(test);

          let one = document.getElementById("one");
          let two = document.getElementById("two");

          one.innerHTML = test.data.name;
          two.innerHTML = test.data.age;
        }}
      >
        ajaxRead
      </button>
      <button
        onClick={() => {
          axios
            .post("http://localhost:8181/sample/update", { age: 50 })
            .then((result) => {
              console.log(result);
            });

          axios.get("http://localhost:8181/sample/read").then((result) => {
            testChange(result);
          });
          console.log(test);

          let one = document.getElementById("one");
          let two = document.getElementById("two");

          one.innerHTML = test.data.name;
          two.innerHTML = test.data.age;
        }}
      >
        ajaxUpdate
      </button>
    </div>
  );
};

export default Test;
